  "continuation": "corteza; y el verde sauz, la violeta,\\nla rosa del abril y el verso amoroso\\nsus frentes inclinaron reverentes,\\nmientras el tiempo en su carrera inquieta\\nva en tu venero fiel consumiendo besos\\ncomo en vaso sagrado; y el amante\\nallí acude, y sus penas olvida,\\ncuando en la noche azul, al resplandor\\nde la luna que platea tu cabellera,\\ny oye tu voz que dice: 'He aquí tu amada.'"
